import './checkout.css'

const CheckOut = () => {
    return (
        <>
        <div className="container">
            <div className="bye">
                <p>Спасибо за покупку!</p>
                <p>Чек отправлен на вашу почту!</p>
                <button className='back'>Вернуться на сайт</button>
            </div>
        </div>
        </>
    )
}

export default CheckOut;
